import logo from "./logo.svg";
import "./App.css";
import React, { useState } from "react";

function App() {
  const [text, setText] = useState("");
  const onChange = (e) => {
    setText(e.target.value);
  };

  return (
    <div className="App">
      <input></input>
      <button className="btn"></button>
      <div className="div"></div>
    </div>
  );
}

export default App;
